AAAAAAAyJmIg/8fwd2OrnmU+FYAAAAASUVORK5CYII=\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":2084,\"height\":730},\"alt\":\"Youssef at the store bying sportswear with his dad\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"303c7a69-02e5-49f6-9160-ca154f009af2\"},{\"params\":{\"text\":\"<p>Youssef likes to wear sports clothes most of the time. Last weekend, he went shopping with his dad. He bought 2 t-shirts for $14.99 each, 1 pair of sweatpants for $23.2, and 3 pairs of socks for $2.34 each.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a59d0f4d-fb4a-4e2d-bc93-88edb4db2498\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1) What is the total cost of all the clothes Youssef bought?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"c56887b5-2417-4846-b060-bd63ad2dbc5c\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2) Youssef's dad paid cash with a $100 bill. How much change should he get back?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"29ae4575-2ac3-43df-bf1e-9ce0f3d578e6\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Question\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Question\"},\"subContentId\":\"a587f31d-dbc0-4dc5-b700-01188bd6d84b\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1)2  14.99 = 29.98</p>\\n\\n<p>3  2.34 = 7.02</p>\\n\\n<p>29.98 + 23.2 + 7.02 = 60.2</p>\\n\\n<p>$60.2 is the total cost of all the clothes Youssef bought.</p>\\n\\n<p>2) 100  60.2 = 39.8</p>\\n\\n<p>He should get $39.8 as change.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5be53ffd-28af-4c84-81bd-5706a0919dec\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC7gAAAOECAMAAAAGnIz6AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAKXUExURf///+/v77+/v9/f339/fxAQEAAAAJ+fnyAgIM/Pz8fHx2BgYPf397e3t3h4eKenp0BAQIeHh+fn55eXl6+vrzg4OBgYGDAwMGhoaCgoKEhISHBwcI+Pj9fX1wgICFBQUFhYWPPD2/3z+OV8sP75++R2rfTJ3tlAjOBkovrn8f39/ezs7Nra2tjY2N3d3eaCtPC31Pjb6dpGkO6rzNtMk/bV5vj4+MHBwbKyssbGxvr6+uuawuqUv/vt9N5Ym91Sl+2lyemOu/K91+7u7srKyvPz8+JqpeNwqbS0tO+x0L6+vt9enunp6fDw8PX19bm5uby8vCkWINVKj8WHpl8qRAUAAnwAPrUcaPXP4raQo8Uxe9E4hCEAEZQASsMqdmkANJkATJsCTs00gLShq8Q1fMYteccuetg/ixMACosARZ8GUtc+ilYAK60UYNTU1LSqr8NCgs82grkgbD4AH8BSiW4ANyYAE75jkI8AR9hNkrp3mMgve7EYZAoABYEAQJ9+j7eMocFOh+3o6n8HQvbx8zUAGs3NzdLS0rWdqcM9gIYAQw4AB00AJsOFpB0ADns9XGQAMsRRisg0fjAAGL0kcHgAO8wzfxgADMkwfOCFskgAJPnh7aMKVmAAMNM6hrOusHMAOasSXtY9iVsALaUMWEMAIakQXOTk5CsAFcEodLp8m+iIuLceauyfxcsyfr1nkrUmbcpck49kece9wsdGhsCttyQfIXkQRKEIVM/Fyu7p600YMstdlNJpnZYCTMoxfeLi4lEAKMUseNQ7h8PDw5ELTtNNkDgbKZF0guvm6HsDPraZp7OlrH47XMVNiN/a3M41gd3F0dA3g78mcq8WYso2gLMaZt9spUM+QOqsy91vpsjIyAAAAFP7LQQAAADddFJOU/////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////8A+TcJrwAAAAlwSFlzAAAOwwAADsMBx2+oZAAAfNVJREFUeF7t/c+LLFt+IHjeRcZVQIFHBPEyPVSq
